window.bookSummaryJSON = "<p><b>The Mercenary Librarians and the Silver Devils are back in </b><b><i>The Devil You Know</i></b><b>, the next installment of </b><b><i>USA Today</i></b><b> and </b><b><i>New York Times</i></b><b> bestselling author Kit Rocha's post-apocalyptic action and romance, with hints of </b><b><i>Orphan Black</i></b><b> and </b><b><i>The Avengers</i></b></p> <p>Maya has had a price on her head from the day she escaped the TechCorps. Genetically engineered for genius and trained for revolution, there's only one thing she can't do—forget.</p> <p>Gray has finally broken free of the Protectorate, but he can't escape the time bomb in his head. His body is rejecting his modifications, and his months are numbered.</p> <p>When Maya's team uncovers an operation trading in genetically enhanced children, she'll do anything to stop them. Even risk falling back into the hands of the TechCorps.</p> <p>And Gray has found a purpose for his final days: keeping Maya safe.</p>"; 
